function guessCharacter() {
    conf.net.outLabelElt.html('_');
    let newLabel = brain.likely(pixelateImage(), conf.net.nn);
    setTimeout(() => conf.net.outLabelElt.html(newLabel), 500);
}

function loadDataset(name) {
    loadBytes(conf.datasets[name].trIP, (r) => conf.datasets.loaded[`i${name}`] = [...r.bytes], () => console.error(`cant load ${conf.datasets[name].trIP}`));
    loadBytes(conf.datasets[name].trLP, (r) => conf.datasets.loaded[`l${name}`] = [...r.bytes], () => console.error(`cant load ${conf.datasets[name].trIP}`));
}

function getDatasetValues(name, id) {
    if (Object.getOwnPropertyNames(conf.datasets.loaded).length !== 0) {
        if (conf.datasets.loaded[`l${name}`] !== undefined && conf.datasets.loaded[`i${name}`] !== undefined
            && conf.datasets.loaded[`l${name}`].length - conf.datasets.labelOffset >= id) {
            let imageLength = conf.gridResolution * conf.gridResolution;
            let obj = {input: {}, output: {}};
            obj.input = scaleDown(conf.datasets.loaded[`i${name}`].slice(conf.datasets.imgOffset + id * imageLength, conf.datasets.imgOffset + id * imageLength + imageLength + 1));
            obj.output[conf.datasets.loaded[`l${name}`].slice(conf.datasets.labelOffset + id, conf.datasets.labelOffset + id + 1)] = 1;
            return obj;
        }
    }
}

function scaleDown(arr) {
    let newArr = [];
    for (let element of arr) {
        newArr.push(map(element, 0, 255, 0, 1));
    }
    return newArr;
}